import React from 'react'
import { Tabs, Tab } from 'react-bootstrap';
import AssesmentActive from './assesment-active/AssesmentActive';
import AssesmentUpcoming from './assesment-upcoming/AssesmentUpcoming';
import AssesmentHistory from './assesment-history/AssesmentHistory';

function Assesment() {
    const [key, setKey] = useState('active');
    return (
        <Tabs
            id="controlled-tab-example"
            activeKey={key}
            onSelect={(k) => setKey(k)}
        >
            <Tab eventKey="active" title="Active">
                <AssesmentActive />
            </Tab>
            <Tab eventKey="upcoming" title="Upcoming">
                <AssesmentUpcoming />
            </Tab>
            <Tab eventKey="history" title="History" disabled>
                <AssesmentHistory />
            </Tab>
        </Tabs>
    )
}

export default Assesment
